import React from 'react';
import ReactDOM from 'react-dom';


const App = () => {

    return (
    <div className='ui comments'>
        <div className='comment'>
            <a href="/" className='avatar'>
                <img  alt="profile picture" />
            </a>
            <div className='content'>

            </div>

        </div>
    </div>
    )
}
ReactDOM.render(
    <App />,
    document.querySelector('#root')
)
